import PropTypes from 'prop-types'

const Header = ({ title }) => { // {} means this property of the parameter
    //normally, it takes it props and we use props.title
    //console.log({title})
  return (
    <header>
        <h1>{title}</h1>
    </header>
    )
}

//if <Header /> is passed with smth, this is overwritten
Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string,
}

export default Header
